  false,\n\t\"url\": null,\n\t\"notes\": \"This document provides a spatially comprehensive
  wetland inventory for east-central Minnesota. Ducks Unlimited, Inc. and the Minnesota
  Department of Natural Resource's Resource Assessment Office partnered to perform
  the National Wetland Inventory update for the east-central area. The project area
  consists of 13 counties in east-central Minnesota including; Anoka, Carver, Chisago,
  Dakota, Goodhue, Hennepin, Isanti, Ramsey, Rice, Scott, Sherburne, Washington, and
  Wright Counties. This inventory provides baseline information for assessing the
  effectiveness of wetland policies and management actions. These data are used at
  all levels of government, as well as by private industry and non-profit organizations
  for wetland regulation and management, land use and conservation planning, environmental
  impact assessment, and natural resource inventories.\",\n\t\"license_title\": \"License
